import React, { useEffect } from "react";
import AppLayout from "../components/AppLayout";
import Head from "next/head";
import SignUpForm from "../components/SignUpForm";

const signup = () => {
  useEffect(() => {
    if (!(me && me.id)) {
      Router.replace("/");
    }
  }, [me && me.id]);
  return (
    <AppLayout>
      <Head>
        <title>signup | nodeBird</title>
      </Head>
      <SignUpForm />
    </AppLayout>
  );
};

export default signup;
